import Link from 'next/link';
import Layout from '../components/Layout';
import Address from '../components/Address';
import Style from '../static/Style';

export default ()=>(
    <Layout header="Address" title="address book">
        <Style>
        <Address />
        <hr />
        <div>
            <Link href="/address_add">
            <button>add</button>
            </Link>
        </div>
        </Style>
    </Layout>
);
